import React, { Component } from 'react';
import logo from '../../assets/Explorer-logo.png';
import './loginPage.css';


export default class LoginPage extends Component {



    render() {
        return (
            <div className="loginSection">

                <div className="loginSquare">
                    <img className="explorer-logo" src={logo} alt="Explorer"/>

                    <h2 className="sharp-text">Login</h2>
                    <h3 className="sharp-text">To Continue To Explorer</h3>


                    <fieldset className="cerdinals-fieldset">
                        <legend>Username</legend>
                        <input type="text" name="username" id="usernameField"/>
                    </fieldset>

                    <fieldset className="cerdinals-fieldset">
                        <legend>Password</legend>
                        <input type="password" name="password" id="passwordField"/>
                    </fieldset>

                </div>

            </div>
        )
    }
}
